INSERT INTO `leave` VALUES (1, 80, 6, 0, '2024-03-17 16:43:03', '2024-03-17 17:43:03', '2024-03-18 16:43:03', 1, '收农头数各直线有收查府约听且只。动研听层文式个矿事它识引难。意科她员我酸约需火认议常问温家子进。或根合书层育位照不论法中张广。没明号入造目看样标却器提同何产放入看。', 'news://opnrtmfi.cv/hwjsrg', NULL, NULL, 106.532, 29.5502, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (2, 80, 6, 2, '2024-03-17 16:43:12', '2024-03-17 17:43:11', '2024-03-18 16:43:11', 1, '任无影类酸照车速了素世革。正机众五住风第正到前青认引照外。知劳中育流局西律农儿对据边风安技立。科展本类离打无为号分准特式示。了示品价立好查度件克着干风半一入影门。', 'cid://dlfv.us/jusuynupdz', NULL, NULL, 106.532, 29.5502, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (3, 80, 6, 0, '2024-03-17 16:43:12', '2024-03-17 17:43:11', '2024-03-18 16:43:11', 1, '消半拉日年矿我这马非就离所国。系下那通图且而具至除数应但。发最已级高是与界加条置其。同自华建响花确压象都一委还再电而五。风区才须须社眼片下所阶军外世表积入式。', 'cid://prnifbx.al/fmyucjgw', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (4, 80, 3, 1, '2024-03-17 16:43:12', '2024-03-17 17:43:11', '2024-03-18 16:43:11', 1, '应已技观属世查他家明市断什根构了。真五只如示头点团问议验取。效包持作集每能样林使石先低特素。矿观始选需局已品性一自省完争。三拉长些团需华特五县造质张却。列其完市人现半量往权样使于毛养又。', 'cid://eiql.bh/tzlngts', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-03-18 22:40:14', '咋滴');
INSERT INTO `leave` VALUES (5, 92, 6, 1, '2024-03-17 16:43:12', '2024-03-17 17:43:11', '2024-03-18 16:43:11', 1, '影车信克现题平她书式到手件。结保及九很更飞展位同书角必现。存那观意铁接型格子标社却步拉最思周。级列商间具任那变市等外局们增克严不。方求上越你定还习力斯争位。照济厂县史开些入照育效听。无据准收战严于表件资活据积千天又。', 'wais://ltzs.io/lbjf', NULL, NULL, 106.532, 29.5502, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (6, 92, 3, 2, '2024-03-17 16:43:12', '2024-03-17 17:43:11', '2024-03-18 16:43:11', 1, '选积正新土音治步么般线联运维值切图往。由达海省示调音了又边说值厂法本。日此把或算口得决转车每非于办等音她米。么应统回格光走理收断没公太影。开龙政史全满如器区技农问斯总张进类。保生层约还都向取决高海学于。众程指如口构受三难下百么极率王。', 'prospero://nas.bn/qssprkyg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (7, 92, 2, 1, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '记经处图世天区数学了织事段保。酸场人全做断求状际他业线极。山历便确动林道严养地生值段传线算各。了儿动日被收层须工斯立强按组统日种。七劳适十金据据手提积东状率之。', 'mailto://pojdbnxbg.am/thql', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (8, 98, 6, 0, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '适究明压书照精个素指离红什是。上意备身快外那数米快很内。制儿支反高者入先下术火引得将制。生采包以圆度与代商一济组解际写导好验。常海学是其子易放积例和究张习别放。条命共片公与指大面消子通铁而商受。', 'news://gjppang.in/lhyf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (9, 98, 3, 2, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '现近口有火种争么入速度除张关形。眼代起具己持支引列位重空样进。这北酸题具史员电总去还当报查明利所。料政写类边有放开以消们过不府元。回子无在建千却领空特写到提每各。', 'telnet://fmjbujbn.mo/mlqpz', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (10, 98, 5, 2, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '必律件同研制认说干应表可形式那边习。从话至则人色酸即者度十加起建各。也值革离为体各金指用斯圆构军许。质车单后再省严或接很般下都表属断林往。上高省每精期少那民展除响身千声达往。过查组持革须科过员意正才直定想。', 'rlogin://mbowoexoq.tm/upszjtm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (11, 99, 2, 1, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '严入外新难队个办议每公省性四个。片马来打太条边细得八青权。走林将设权多效电理极提使角发家内。产走米图手院保该于向中精老。内史究青金但展车品问自常圆用矿。满无前或光会由军起支快者。', 'telnet://uxbczvdfvj.cd/vvffzbabkc', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (12, 99, 6, 1, '2024-03-17 16:43:12', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '代别斯整具就却计只知流素做。市体局八教过法却温住直办决复将从品。劳革题京层科置实方与名来常极管带都。条深教容制按结次达参论广当热根运中。直据所使那门置真代类料力种委称。些所次到数解务和百华空精造。', 'wais://vsbl.bm/ebsixcjc', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (13, 99, 5, 2, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '相强格品情院率此月十来理外从高南。机角建党求受段要明节率万治相值。美带运儿感于样置器局片济好少越期立。参光什广商间么律立支等的了。', 'ftp://jnmnifco.bo/nnjd', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (14, 112, 3, 0, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '离时参它术到了发三清事决手群。资状世保无线好要高精来照与什经院。解家人清交要验才方亲则建复今强比求。称几每再目可具西响认革直写立过带龙。将上律高色速几布识影候则活。', 'mailto://tuff.pm/rwyxwndb', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (15, 112, 4, 1, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '两利展当什取走题世张同提公安务表清。事因极通京整术县记关义派果。验比在置建技关走则温水按属件使然。如据又东按人严识米次九明议。指金装由资更好算日关成车山农不它传。', 'prospero://ssgzotopll.tel/hlgalw', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (16, 112, 2, 3, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '活调何间政治行更院音斗各华权基。白交年难入心适油日热两快性整必当质。养全江交领党变识们农分育代关。信构命实走很集张做声选去五七。置或好马拉去研本适验六即走则。', 'gopher://xfcs.ev/bttltwa', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (17, 112, 1, 1, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '易从消拉术身步众酸热质你用难花当真。见面二被此百参感立关习单素认样。收认极全产专量并观持争及面她经住更斯。现作斯文次又产取它需队行四每装。再由候商在据变米入家其该主五。', 'http://ubegp.gov.cn/kbyioybsd', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (18, 181, 1, 1, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '验斯细用入易验者温矿系万量日出。体走不果斗约思亲事平家半变厂是接。少众志提行矿天科满它准专价。江会候事平山北它以整红团量今。', 'news://jfbt.lb/wegu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (19, 181, 5, 3, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '转将种万系院教现华素口新正。样员压已事设位报到民算儿比在米易。候把十音五广类品研照手温平铁家口格。大月严查而阶节流想也风走影最声。连长亲太约水行消级年入认机认从记。查称海过满群消新角农比以律革积。完志道采周最器成江压论此节由人。', 'news://uvrvvdftm.bn/lkmcumjnv', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (20, 181, 5, 2, '2024-03-17 16:43:13', '2024-03-17 17:43:12', '2024-03-18 16:43:12', 1, '什叫细利世术状世林以和与称。复院多率专色积在证且织热叫圆力这则放。究新元元情消理属段放革清行发。时前酸那没和党标中重两质须存。家该达新团务叫可美空认事。', 'prospero://fqyobghhab.ae/jqslu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (21, 181, 0, 1, '2024-03-17 16:43:13', '2024-03-17 17:43:13', '2024-03-18 16:43:13', 1, '派备进世率称各情题工关斯重土。论引今统结决作都去样斗华很运能。场设史程拉该民面长包元多具方。', 'nntp://osfyb.gy/nmundvbvpu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (22, 181, 2, 0, '2024-03-17 16:43:13', '2024-03-17 17:43:13', '2024-03-18 16:43:13', 1, '流单毛信毛这治集然线调立天带社本酸。切较成持万律万际着叫平区接置。把与书元新各传具劳厂人后至飞。制明片县由该率相克强应工议党具与家制。战价向形近计据儿改金成如里政正。', 'prospero://ivyhfovlu.ae/wesuckyn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (23, 181, 3, 2, '2024-03-17 16:43:13', '2024-03-17 17:43:13', '2024-03-18 16:43:13', 1, '白矿实八四期即派布近并都非便技求们。较资则热都先者还劳定道各值石重速。此千回主儿史便书因装家物加料术转容。战名月立石劳采今书连众之示这理结半。', 'telnet://jgqbtltx.cn/tshobniy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
