INSERT INTO `leave` VALUES (60, 381, 3, 2, '2024-03-17 16:43:34', '2024-03-17 17:43:34', '2024-03-18 16:43:34', 1, '用设法红调电见的连后布精克界规那。强花下油气争权常目满物温。北取议计包术革基青积志张难强结场。入影养一复铁直话空过织场报转水铁。想改领平容话后下车院备五权切。织区别位处细适大单第很达并听江步。', 'mid://xysjfspqvr.gh/zshzlvpu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `leave` VALUES (61, 381, 2, 2, '2024-03-17 16:43:34', '2024-03-17 17:43:34', '2024-03-18 16:43:34', 1, '业前任叫各安满同华后员实理地中那。地较多增此局由相同产第理感对团什就相。小运完角说到议第内划到例原年。圆水习活管应动以回与之名技影。治今前因你装细族社总相型月半。分须做传矿论圆你党做料型转备即其务社。', 'cid://cwdr.org/vikkqlrpd', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
